<div class="entities" style="line-height: 2.5; direction: ltr">Antiaging gene Q9UEF7 regulates endothelin - 1 levels and endothelin receptor subtype B expression in kidneys of spontaneously hypertensive rats . OBJECTIVE : Q9UEF7 is an antiaging gene and is predominately expressed in kidneys . The endothelin system is critical in the regulation of kidney function . The objective of this study is to assess whether klotho affects the renal endothelin system in spontaneously hypertensive rats ( SHRs ) . METHOD : Four groups of male SHRs and one group of male Wistar-Kyoto ( WKY ) rats were used . In-vivo expression of klotho was achieved by AAV 2 delivery of mouse klotho full-length cDNA ( AAV.mKL ) . Four groups of SHRs were given ( intravenously ) AAV.mKL , AAV.LacZ , AAV.GFP , and phosphate-buffered saline , respectively . The WKY group was given phosphate-buffered saline and served as a control . At the end of week 12 after gene delivery , all animals were euthanized . RESULTS : Plasma endothelin - 1 ( ET - 1 ) and renal ET - 1 levels were increased in SHRs vs . WKY rats . In-vivo expression of klotho reversed the elevated ET - 1 levels in SHRs . ETB receptor protein expression was decreased in both kidney cortex and medulla of SHRs . Interestingly , in-vivo expression of klotho abolished the downregulation of ETB protein expression in SHRs , suggesting that klotho regulates ETB receptor expression . Q9UEF7 gene delivery also eliminated the increase in the ratio of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25101
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / ETB in SHRs . Mitochondrial superoxide dismutase ( Mn-SOD ) protein expression was decreased in kidneys of SHRs , which was rescued by in-vivo expression of klotho . CONCLUSION : Q9UEF7 gene delivery abolished the upregulation of ET - 1 levels and the downregulation of ETB and Mn-SOD expression in kidneys of SHRs . These findings revealed a previously unidentified role of klotho in the regulation of the renal ET system and Mn-SOD in SHRs .</div>

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Endothelin @25 - new agonists , antagonists , inhibitors and emerging research frontiers : IUPHAR Review 12 . Since the discovery of endothelin ( ET ) - 1 in 1988 , the main components of the signalling pathway have become established , comprising three structurally similar endogenous 21 - amino acid peptides , ET - 1 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P20800
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14138
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , that activate two GPCRs , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25101
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and ETB . Our aim in this review is to highlight the recent progress in ET research . The ET-like domain peptide , corresponding to prepro-ET -193-166 , has been proposed to be co-synthesized and released with ET - 1 , to modulate the actions of the peptide . ET - 1 remains the most potent vasoconstrictor in the human cardiovascular system with a particularly long-lasting action . To date , the major therapeutic strategy to block the unwanted actions of ET in disease , principally in pulmonary arterial hypertension , has been to use antagonists that are selective for the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25101
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptor ( ambrisentan ) or that block both receptor subtypes ( DB00559 ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08932
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 represents the next generation of antagonists , being more potent than DB00559 , with longer receptor occupancy and it is converted to an active metabolite ; properties contributing to greater pharmacodynamic and pharmacokinetic efficacy . A second strategy is now being more widely tested in clinical trials and uses combined inhibitors of ET-converting enzyme and neutral endopeptidase such as SLV 306 ( daglutril ) . A third strategy based on activating the ETB receptor , has led to the renaissance of the modified peptide agonist IRL 1620 as a clinical candidate in delivering anti-tumour drugs and as a pharmacological tool to investigate experimental pathophysiological conditions . Finally , we discuss biased signalling , epigenetic regulation and targeting with monoclonal antibodies as prospective new areas for ET research .</div>

 Coronary Angiography Trial ( LOCAT ) , a trial examining the effect of gemfibrozil treatment on progression of atherosclerosis after bypass surgery and on risk of IHD in the second Northwick Park Heart Study ( Q9NP85 ) , a prospective study of healthy middle-aged men in the United Kingdom . There was no association with plasma lipid concentrations in either study . Both polymorphisms influenced progression of atherosclerosis and risk of IHD . V162 allele carriers had less progression of diffuse atherosclerosis than did L162 allele homozygotes with a similar trend for focal atherosclerosis . Intron 7 C allele carriers had greater progression of atherosclerosis than did G allele homozygotes . The V162 allele attenuated the proatherosclerotic effect of the intron 7 C allele . Homozygotes for the intron 7 C allele had increased risk of IHD , an effect modulated by the L162V polymorphism CONCLUSIONS : The PPARalpha gene affects progression of atherosclerosis and risk of IHD . Absence of association with plasma lipid concentrations suggests that PPARalpha affects atherosclerotic progression directly in the vessel wall .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Molecular basis of organ fibrosis : potential therapeutic approaches . Fibrosis , a non-physiological wound healing in multiple organs , is associated with end-stage pathological symptoms of a wide variety of vascular injury and inflammation related diseases . In response to chemical , immunological and physical insults , the body ' s defense system and matrix synthetic machinery respond to healing the wound and maintain tissue homeostasis . However , uncontrolled wound healing leads to scarring or fibrosis , a pathological condition characterized by excessive synthesis and accumulation of extracellular matrix proteins , loss of tissue homeostasis and organ failure . Understanding the actual cause of pathological wound healing and identification of igniter ( s ) of fibrogenesis would be helpful to design novel therapeutic approaches to control pathological wound healing and to prevent fibrosis related morbidity and mortality . In this article , we review the significance of a few key cytokines ( TGF- , IFN- ,

 ) transcriptional activators ( Sp1 , Egr - 1 , P8 4022 ) , repressors (

 , Fli - 1 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
